async def fofaSearch(keyword):
    url = "https://fofa.so/api/v1/search/all?email={}&key={}&qbase64={}&size=10000&fields=host"
    async with aiohttp.ClientSession() as session:
        result = await AsyncFetcher.fetch(session=session, url=url.format(config.fofaEmail, config.fofaApi, base64.b64encode(keyword.encode()).decode()), json=True)
        return result.get('results')

